-- View structure for dpt_v
-- ----------------------------
DROP VIEW IF EXISTS `dpt_v`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `dpt_v` AS SELECT
	a.id_dpt,
	a.no_kk,
	a.nik,
	a.nama,
	a.tempat_lahir,
	a.tanggal_lahir,
	a.jenis_kelamin,
	a.alamat,
	a.rt,
	a.rw,
	b.nama_kecamatan,
	a.id_kecamatan,
	c.nama_kelurahan,
	a.id_kelurahan,
	e.nama_tps,
	a.id_tps,
	f.nama_tim,
	a.id_tim,
	a.no_hp
FROM
	m_dpt a
	LEFT JOIN m_kecamatan b ON ( a.id_kecamatan = b.id_kecamatan ) and b.status_id = 1
	LEFT JOIN m_kelurahan c ON ( a.id_kelurahan = c.id_kelurahan ) and c.status_id = 1
	LEFT JOIN m_tps e ON ( a.id_tps = e.id_tps ) and e.status_id = 1
	left join m_tim f ON (a.id_tim = f.id_tim) and f.status_id = 1
where 
a.status_id = 1
ORDER BY 
-- b.nama_kecamatan,
-- c.nama_kelurahan
-- asc,
f.nama_tim
asc ;

