-- ----------------------------
-- View structure for kecamatan_list
-- ----------------------------
DROP VIEW IF EXISTS `kecamatan_list`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `kecamatan_list` AS SELECT
	kec.id_kecamatan,
	kec.nama_kecamatan,
	count(dpt.id_dpt) as jumlah_dpt,
	kec.status_id
FROM
	m_kecamatan kec
	left join m_dpt dpt on (kec.id_kecamatan = dpt.id_kecamatan) 
where kec.status_id = 1 
GROUP BY
kec.id_kecamatan,
	kec.nama_kecamatan,
	kec.status_id ;

-- ----------------------------
-- View structure for kelurahan_list
-- ----------------------------
DROP VIEW IF EXISTS `kelurahan_list`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `kelurahan_list` AS SELECT
	a.id_kelurahan,
	a.nama_kelurahan,
	a.id_kecamatan,
	a.nama_kecamatan,
	a.jumlah_tps,
	count( dpt.id_dpt ) AS jumlah_dpt,
	a.status_id 
FROM
	(
	SELECT
		kel.id_kelurahan,
		kel.nama_kelurahan,
		kec.id_kecamatan,
		kec.nama_kecamatan,
		count( tps.nama_tps ) jumlah_tps,
		kel.status_id 
	FROM
		m_kelurahan kel
		LEFT JOIN t_kelurahan_tps t ON ( kel.id_kelurahan = t.id_kelurahan )
		LEFT JOIN m_tps tps ON ( t.id_tps = tps.id_tps )
		LEFT JOIN m_kecamatan kec ON ( kel.id_kecamatan = kec.id_kecamatan ) 
	WHERE
		kel.status_id = 1 
	GROUP BY
		kel.id_kelurahan,
		kel.nama_kelurahan,
		kel.status_id,
		kec.id_kecamatan,
		kec.nama_kecamatan 
	) a
	LEFT JOIN m_dpt dpt ON ( a.id_kelurahan = dpt.id_kelurahan ) -- left join m_kecamatan kec on (dpt.id_kecamatan = kec.id_kecamatan)
	
GROUP BY
	a.id_kelurahan,
	a.nama_kelurahan,
	a.jumlah_tps,
	a.id_kecamatan,
	a.nama_kecamatan,
	a.status_id ;

-- ----------------------------
-- View structure for tim_list
-- ----------------------------
DROP VIEW IF EXISTS `tim_list`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `tim_list` AS SELECT
	t.id_tim,
	t.nama_tim,
	t.nama_ketua,
	t.deskripsi,
	t.status_id,
	count( a.id_dpt ) AS konstituen 
FROM
	m_tim t
	LEFT JOIN m_dpt a ON ( t.id_tim = a.id_tim ) 
WHERE
	t.status_id = 1 
GROUP BY
	t.id_tim,
	t.nama_tim,
	t.nama_ketua,
	t.deskripsi,
	t.status_id ;

SET FOREIGN_KEY_CHECKS = 1;
